  beforeEach(async () => {
    await TestBed.configureTestingModule({
      declarations: [ AssignmentContainerComponent ]
    })
    .compileComponents();
  });

  beforeEach(() => {
    fixture = TestBed.createComponent(AssignmentContainerComponent);
